function CreateButton(task) {

    return(

        <>

            <div class="form-check">
                <input class="form-check-input" type="checkbox" value="" id="flexCheckDefault"/>
                <label class="form-check-label" for="flexCheckDefault">
                    Default checkbox
                </label>
            </div>
            <div class="form-check">
                <input class="form-check-input" type="checkbox" value="" id="flexCheckChecked" checked/>
                <label class="form-check-label" for="flexCheckChecked">
                    Checked checkbox
                </label>
            </div>

        </>


    );

};


function Content(){

    return(

        <>

            <div className="sm">

                <form class="d-flex sl" role="search">
                    <input class="form-control me-2 sl" type="search" placeholder="Task" aria-label="Search"/>
                    <button class="btn btn-outline-success sl" type="submit">Aggiungi</button>
                </form>

            </div>


        </>


    );

};

export default Content;
